    return <a className="rounded-md bg-gray-900 px-3 py-2 text-sm font-medium text-white" aria-current="page" {...props}></a>
}

export const ButtonMain = (props) => {
    return <a className="rounded-md px-3 py-2 text-sm font-medium text-gray-300 hover:bg-gray-700 hover:text-white" {...props}></a>
}
